import React from 'react';
import './App.css';
import Cart from './cart/Cart.js'
import ListItems, { mapDispatchToProps } from './list-items/ListItems.js'
import itemsData from './dataFile'
import { connect } from 'react-redux'

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <ListItems items={itemsData} />
        <Cart />
      </div>
  )
  }
}



export default connect(null, mapDispatchToProps)(App)
